            var message = "àÈÔâÒØÕÜãÖÊçåÈÔ";
            var secret = "scones";
            var result = Cypher.Decrypt(Cypher.Ascii(), secret, message);
            var expected = "meetmebythetree";
            Assert.Equal(expected, result);
        }


        [Fact]
