            var message = "Cypher.Encrypt(Cypher.Ascii(), secret, message)Cypher.Decrypt(Cypher.Ascii(), secret, encrypted)";
            var secret = "scones";
            var encrypted = Cypher.Encrypt(Cypher.Ascii(), secret, message);
            Debug.WriteLine(encrypted);
            var result = Cypher.Decrypt(Cypher.Ascii(), secret, encrypted);
            Assert.Equal(message, result);
